import NoticeList from "../components/NoticeList";
import React, { useCallback} from 'react';
import {useDispatch} from 'react-redux';
import { getNtc } from '../modules/notice'

const NoticeContainers = (props) => {
    const dispatch = useDispatch();
    const OnChage = useCallback(() => dispatch(getNtc()), [dispatch]);
    return (
        <>
            <div>
                {props && props.map(list => (
                    <>
                        <NoticeList props={list} key={list.NTC_ID}></NoticeList>
                    </>
                ))}
            </div>
        </>
    )
};

export default NoticeContainers;
